import Head from 'next/head';
import Navbar from '../components/navbar';
import Footer from '../components/footer';
import { Fragment } from 'react';

export default (Page) => {
    return () => (
        <Fragment>
            <Head>
                <title>My page</title>
            </Head>
            <Navbar/>
            <Page/>
            <Footer/>
        </Fragment>

    );
}
